キビキビと、そして大きくスイングするテールアクション。ボトムでのズル引きやカーブフォールによるスイミングで効果絶大です。水を良く掴み、水流負けしないテールデザインがミソ。ジグヘッドはもとより、テキサス、キャロライナ、ダウンショットリグ、そしてネコリグやジグトレーラー等、あらゆる使い方で効果を発揮します。あまりシェイク等の小技を入れずに、スローにシンプルに使うことをお勧めいたします。<hr>4.3インチ<hr>6本入り<hr>天然イカフレーバー入り<style>
