  text-indent:-9999px;
  width: 214px;
  height: 43px;
  background:url(http://image.rakuten.co.jp/backlash/cabinet/kago-b.gif) #fff no-repeat;
  cursor:pointer;
  border:none;
  margin: 5px 0;
}


