  border:solid #ccc 1px;
  background:#fff!important;
  width:30px;
  height:30px;
  cursor:auto;
  padding:7px 7px 7px 3px;
}

/*お問い合わせボタン*/
font input[value="商品についての問い合わせ"] {
  text-indent:-9999px;
  width: 285px;
  height: 43px;
  background:url(http://image.rakuten.co.jp/backlash/cabinet/toiawase.gif) #fff no-repeat;
  border:none;
  cursor:pointer;
  margin: 0 0 10px;
}


/*再販ボタン*/
font input[value="この商品の再販に「1票」"] {
  text-indent:-9999px;
  width: 285px;
  height: 43px;
  background:url(http://image.rakuten.co.jp/backlash/cabinet/saihan.gif) #fff no-repeat;
  border:none;
  cursor:pointer;
  margin: 0 0 5px;
}

</style>

